// IsSolid returns true if the block has a non-empty bounding box.
func IsSolid(id int) bool {
	if solid, ok := IsSolidMap[id]; ok {
		return solid
	}
	// 預設為不固體 (如空氣)
	return false
}

// GetHardness returns the block's hardness, -1 if unbreakable.
func GetHardness(id int) float64 {
	if hardness, ok := GetHardnessMap[id]; ok {
		return hardness
	}
	// 預設 (未知方塊)
	return -1.0
}

