// BlockIDToName maps block IDs to names for reverse lookup.
var BlockIDToName = make(map[int]string)

func init() {
	for name, id := range BlockNameToID {
		BlockIDToName[id] = name
	}
}

// GetBlockName returns the name for a block ID.
func GetBlockName(id int) (string, bool) {
	name, ok := BlockIDToName[id]
	return name, ok
}

// GetBlockID returns the ID for a block name.
func GetBlockID(name string) (int, bool) {
	id, ok := BlockNameToID[name]
	return id, ok
}
